The following query answers your request. I've used the ASK WHERE clause and a SUBQUERY for a better performance.

```
VALUES (COUNT(?sub)) AS ?value {
 SELECT ?sub wdt:P1233 wd:Q15645123 
WHERE {
   ?sub wdt:P21 wd:Q6581072 
}
}

# Replace wd:Q15645123 with the real term that you want to compare
```

This is basically the same query as:

```
CREATE VIEW ▽️ WHERE {
   ASK WHERE {
      ?sub wdt:P1233 wd:Q15645123 
      ?sub wdt:P21 wd:Q6581072
  }
  VALUES (COUNT(?sub)) AS ?value
}
```

